import styled from 'styled-components';

const StyleCustom = (props) => {
  const StyledCounter = styled.div`
    :root {
      background-color: #a1a1ff;
    }
    .darkTheme {
      --user-color: ${props.themeStyle.color};
      --background-color: ${props.themeStyle.backgraungColor};
    }
    .lightTheme {
      --user-color: ${props.themeStyle.color};
      --background-color: ${props.themeStyle.backgraungColor};
    }
  `;
  console.log(props.themeStyle);
  return <StyledCounter className="darkTheme">{props.children}</StyledCounter>;
};

export default StyleCustom;
